import React from "react";
import { Box, Heading, Image } from "@chakra-ui/react";
import ShopCarousel from "./shop.components/shop.carousel";
import ShopCarouselGallery from "./shop.components/CarouselGallery";
import ShopNavbar from "./shop.components/ShopNavbar";
import { Route, Routes } from "react-router-dom";
import SingleProduct from "./shop.components/SingleProduct";

export default function ShopHome() {
  return (
    <Box>
      {/* <ShopNavbar /> */}
      <ShopCarousel />
      <ShopCarouselGallery />
      <Image src="https://cdn-images.cure.fit/www-curefit-com/image/upload/fl_progressive,f_auto,q_auto:eco,w_1312,ar_1312:560/dpr_2/image/vm/12349520-7d24-4470-911c-d8b9c78f23f8.png"/>
    </Box>
  );
}
